p.note:
In brown ink by different medieval hands, obits of lay bishops, founders and other persons. For example:
                                        : Obiit Baldwinus, olomucensis decanus;
                                        : Obiit Pribislava soror nostra;

                                        : Obiit Dragoslaua soror nostra;
                                        : Obiit Wencezlaus dux fundator olomucensis ecclesie;
                                        : Zuatopulk dux boemie iaculo perforatus est.
                                        See further 
                                            Dudík (1880)
                                        ; pp. 3-16, 
                                            Friedl (1927)
                                        ; pp. 103-114, 
                                            Bistřický (2011)
                                        ; p. 157.
